import React from "react";

function HelloDiv() {
  return  <div>
    <h1>Hi my name is, what?, my name is, who? my name is... chicka chicka SLIM SHADY</h1>
    <ul>
      <li>HOT POTATOES</li>
      <li>COLD POTATOES</li>
      <li>WARM POTATOES</li>
      <li>NO KETCHUP!</li>
    </ul>
  </div>;
}

export default HelloDiv;
